import { makeStyles } from '@mui/styles';

export default makeStyles(() => ({
 sidebar: {
    display: 'flex',
    flexDirection: 'column',
    width: '100%',
    maxWidth: '200px',
    padding: '0 20px',
    boxSizing: 'border-box',
 },
 sidebarListItem: {
    padding: '0',
 },
 sidebarListItemIcon: {
    minWidth: 'auto',
    marginRight: '10px',
 },
}));
